import React from 'react'
import useMenus from '../data/useMenus'

const MenusPrimary = () => {
    var menuLength = '';
    var menuData = [];
    const menusInfo = useMenus();
    menusInfo.map(item => (
        menuLength = item
    ))

    if (menuLength.length > 0 ) {
        menuLength.map(item => (
            menuData = item
        ))
    }
    console.log(menuData);
    return (
        <div>MenusPrimary</div>
    )
}

export default MenusPrimary
